import React from "react";
import {
  Container,
  Navbar as NavbarComp,
  NavDropdown,
  Nav,
} from "react-bootstrap";
import { Link } from "react-router-dom";
import booksLogo from "../../assets/books-logo.png";
import blankProfile from "../../assets/blank-profile.jpeg";

function NavbarAdmin(props) {
  return (
    <NavbarComp expand="lg">
      <Container>
        <NavbarComp.Brand as={Link} to="/">
          <img
            src={booksLogo}
            className="img-fluid rounded rounded-5"
            style={{ width: "60px", height: "45px" }}
            alt="brand"
          />
        </NavbarComp.Brand>

        <NavbarComp.Toggle aria-controls="basic-navbar-nav" />
        <NavbarComp.Toggle aria-controls="basic-navbar-nav" />
        <NavbarComp.Collapse id="basic-navbar-nav">
          <Nav className="ms-auto">
            <NavDropdown
              className="dropdown-toggle::after dropstart"
              eventkey={1}
              title={
                <div className="ms-autof-2">
                  <img
                    className="rounded-circle border border-3"
                    style={{ width: "35px", height: "35px" }}
                    src={blankProfile}
                    alt="UserPic"
                  />
                  Admin
                </div>
              }
            >
              <Nav.Link
                as={Link}
                to="/book-list"
                className={
                  props?.title === "Book-List"
                    ? `text-navbar-active`
                    : `text-navbar`
                }
              >
                Add Book
              </Nav.Link>
              <Nav.Link
                as={Link}
                to="/transaction"
                className={
                  props?.title === "List-Transaction"
                    ? `text-navbar-active`
                    : `text-navbar`
                }
              >
                List Transaction
              </Nav.Link>
              <Nav.Link
                as={Link}
                to="/complain-admin"
                className={
                  props?.title === "Complain-Admin"
                    ? `text-navbar-active`
                    : `text-navbar`
                }
              >
                Complain Admin
              </Nav.Link>
              <Nav.Link onClick="" className="text-navbar">
                Logout
              </Nav.Link>
            </NavDropdown>
          </Nav>
        </NavbarComp.Collapse>
      </Container>
    </NavbarComp>
  );
}

export default NavbarAdmin;
